import "./App.css";
import React, { Component } from "react";
import Navbar from "./components/Navbar";
import News from "./components/News";

import * as ReactDOM from "react-dom/client";
import { BrowserRouter, Link, Route, Routes } from "react-router-dom";

export default class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <Routes>
          <Route
            path="/"
            element={
              <div>
                <Navbar />
                <News pageSize={9} country="in" category="general" />
              </div>
            }
          />
          <Route
            path="/buisness"
            element={
              <div>
                <Navbar />
                <News pageSize={9} country="in" category="buisness" />
              </div>
            }
          />
          <Route
            path="/entertainment"
            element={
              <div>
                <Navbar />
                <News pageSize={9} country="in" category="entertainment" />
              </div>
            }
          />
          <Route
            path="/health"
            element={
              <div>
                <Navbar />
                <News pageSize={9} country="in" category="health" />
              </div>
            }
          />
          <Route
            path="/science"
            element={
              <div>
                <Navbar />
                <News pageSize={9} country="in" category="science" />
              </div>
            }
          />
          <Route
            path="/sports"
            element={
              <div>
                <Navbar />
                <News pageSize={9} country="in" category="sports" />
              </div>
            }
          />
          <Route
            path="/technology"
            element={
              <div>
                <Navbar />
                <News pageSize={9} country="in" category="technology" />
              </div>
            }
          />

        </Routes>
      </BrowserRouter>
    );
  }
}
